import React from 'react'

const List = (people) => {
    console.log("This is it")
    console.log(people)
    {people.map((person)=>{
    return (
        <article className='person'>
            <img src={person.image} alt="" />
            <div>
                <h4>Bertie Yate</h4>
                <p>29</p>
            </div>
        </article>
    )
    })}
}

export default List
